import React from 'react';
import s from './Footer.module.css';

const Footer = () => {
  return (
      <div className={s.footer}>
        <div>
          <span>2021 - 2022 all right reserved</span>
          <span>design by FORTRIX</span>
        </div>
      </div>
  );
};

export default Footer;
